    (function(){
      var uuidPattern = /[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12}/gmi;
      var numPattern = /d+/gmi;

      }
      var canUseLocalStorage;

        window.localStorage;

      if (canUseLocalStorage) {
        var storedRef;

          ref = storedRef
        } else if(isValidHash) {
          localStorage.setItem('grid-referrer', hash);
        }
      }

      // adding to use in cta
      window.ref = ref;
    })();

    function getQueryVariable(variable){
       var query = window.location.search.substring(1)
       var vars = query.split("&")
       for (var i=0;i<vars.length;i++) {
         var pair = vars[i].split("=");
         if(pair[0] == variable){return pair[1]}
       }
       return(false);
    }
    var utm_source=getQueryVariable('utm_source')
    var utm_medium=getQueryVariable('utm_medium')
    var canUseLocalStorage;
    try {
      window.localStorage;
      canUseLocalStorage = true;
      } catch (e) {
      canUseLocalStorage = false;
    }
    if (canUseLocalStorage){
      if (utm_source && utm_medium){
        localStorage.setItem('utm_source',utm_source);
        localStorage.setItem('utm_medium',utm_medium);
      }
      else{
        utm_source=localStorage.getItem('utm_source');
        utm_medium=localStorage.getItem('utm_medium');
      }
    }
    if (utm_source && utm_medium){
      window.grid_affiliate={utm_source: utm_source, utm_medium: utm_medium}
    }
  })();
